import React, { Component } from 'react';
import PropTypes from 'prop-types';
import Form from 'react-bootstrap/Form';

import '../account.css';

interface CustomFormTextPropTypes {
  className?: string;
  defaultChildren?: string;
  children?: React.ReactNode;
}

export const CustomFormText = ({ className, defaultChildren, children }: CustomFormTextPropTypes) => <Form.Text
  className={
    [
      (children ? 'text-danger' : 'text-muted'),
      'accountAsideFormGroupText',
      ...([className,] || [])
    ]}>
  {children || (defaultChildren || '\u00A0')}
</Form.Text>;
